                                if (x1.bandwidth() > 100) {
                                        x = x1(d.key) + parseFloat(x1.bandwidth() / 3);
                                        width = parseFloat(x1.bandwidth() / 3);
                                } else {
                                        x = x1(d.key);
                                        width = parseFloat(x1.bandwidth());
                                }
